import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";

function Iterate(params) {
  const entries = [];
  params.forEach((element) => {
    entries.push(
      <ExpenseItem
        title={element.title}
        amount={element.amount}
        date={element.date}
      ></ExpenseItem>
    );
  });
}

function Expenses(props) {
  var expenses = props.list;
  return <div>Iterate(props.list)</div>;
}

export default Expenses;
